-- ------------------------------------------------------

CREATE TABLE coin (
    id   SERIAL PRIMARY KEY,
    face_value          TEXT    NOT NULL,
    currency_id         INTEGER NOT NULL,
    pretty_name         TEXT,
    series_theme_name   TEXT,
    obverse             TEXT    NOT NULL,
    reverse             TEXT    NOT NULL,
    edge                TEXT    NOT NULL,
    years               TEXT,
    composition         TEXT,
    weight_grams        REAL,
    diameter_mm         REAL,
    shape_id            INTEGER,
    comments            TEXT,
    country_id          INTEGER,
    designer_obv_id     INTEGER,
    designer_rev_id     INTEGER,
    mint_id             INTEGER, -- mint marks can be found in coin_mintmark table. There should not be entries in both of the tables for the same coin.
    FOREIGN KEY (mint_id) REFERENCES mint (id),
    FOREIGN KEY (currency_id) REFERENCES currency (id),
    FOREIGN KEY (shape_id) REFERENCES shape (id),
    FOREIGN KEY (country_id) REFERENCES country (id),
    FOREIGN KEY (designer_obv_id) REFERENCES designer (id),
    FOREIGN KEY (designer_rev_id) REFERENCES designer (id)
);

-- ------------------------------------------------------

CREATE TABLE coin_mintmark (
    id   SERIAL PRIMARY KEY,
    coin_id  INTEGER NOT NULL,
    mintmark_id INTEGER NOT NULL,
    FOREIGN KEY (coin_id) REFERENCES coin (id),
    FOREIGN KEY (mintmark_id) REFERENCES mintmark (id)
);

-- ------------------------------------------------------

CREATE TABLE coin_image (
    id   SERIAL PRIMARY KEY,
    coin_id  INTEGER NOT NULL,
    image_id INTEGER NOT NULL,
    FOREIGN KEY (coin_id) REFERENCES coin (id),
    FOREIGN KEY (image_id) REFERENCES image (id)
);

-- ------------------------------------------------------

CREATE TABLE "collection" (
    id                  SERIAL PRIMARY KEY,
    coin_id             INTEGER,
    year                TEXT,
    mint_id             INTEGER,
    mintmark_id        INTEGER, -- collection should have either mint_id or mintmark_id but not both.
    grade_id            INTEGER,
    condition           TEXT,
    paid_amount         REAL,
    paid_currency_id    INTEGER,
    sourced_from        TEXT,
    sourced_when        TEXT,
    is_cleaned          BOOLEAN NOT NULL DEFAULT (false),
    FOREIGN KEY (mint_id) REFERENCES mint (id),
    FOREIGN KEY (mintmark_id) REFERENCES mintmark (id),
    FOREIGN KEY (paid_currency_id) REFERENCES currency (id),
    FOREIGN KEY (grade_id) REFERENCES grade (id),
    FOREIGN KEY (coin_id) REFERENCES coin (id)
);

-- ------------------------------------------------------

CREATE TABLE coinset (
    id   SERIAL PRIMARY KEY,
    name TEXT NOT NULL
);

-- ------------------------------------------------------

CREATE TABLE coinset_coin (
    id          SERIAL PRIMARY KEY,
    coinset_id  INTEGER NOT NULL,
    coin_id     INTEGER NOT NULL
);
